using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public struct GroundedTagComponentResolver : IResolver<GroundedTagComponent>, IResolver<GroundedTagComponentResolver,GroundedTagComponent>, IData	{		public GroundedTagComponentResolver In(ref GroundedTagComponent groundedtagcomponent)		{			return this;		}		public void Out(ref IEntity entity)		{			var local = entity.GetGroundedTagComponent();			Out(ref local);		}		public void Out(ref GroundedTagComponent groundedtagcomponent)		{		}	}}